import React from 'react';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';

const Landing = () => {
    return (
        <Grid container style={{ backgroundColor: "salmon", maxHeight: "100vh" }}>
            <Grid item xs={6} style={{ backgroundColor: "skyblue", height: "75vh", width: "50vw" }} >
                Right top
            </Grid>
            <Grid item xs={6} style={{ backgroundColor: "olive", height: "75vh", width: "50vw" }}>
                Left Top
                <Link to="/nomination">
                    <Button>
                        Get Started
                </Button>
                </Link>
            </Grid>
            Bottom
            <Grid item xs={12} style={{ position: "relative" }}>
                <img style={{ height: "100%", position: "absolute", height: "600px", bottom: "-1200px" }}
                    alt="pengu" src="https://i.natgeofe.com/n/4bf47147-ce80-49c6-98ae-52f63349045f/67655.jpg" />
            </Grid>
        </Grid>
    );
};

export default Landing;
